import './App.css';

const App = () => {
  return (
    <div className="note-app-container">
      {/* Left column for previous notes */}
      <div className="previous-notes-grid">
        <div className="previous-note">
          <div className="previous-note-title">
            <h2>Note title</h2>
            <button>Delete</button>
          </div>
          <p>Note content</p>
        </div>

      </div>

      <div className="new-note-form">
        <form>
          <input placeholder="Enter title here..." required />
          <textarea
            placeholder="Enter text here..."
            rows={10}
            required
          ></textarea>
          <button type="submit">Create new note</button>
        </form>
      </div>
    </div>
  );
};

export default App;
